import React from 'react';
import './index.css';

const BookCard = () => {
    return (
        <div className="book-card">
            <div className="book-information">
                <div className="title">
                    Book Title
                </div>
                <div className="author">
                    Book Author
                </div>
            </div>

            <div className="library-information">
                <div>3 copies left.</div>
                <button>Reserve</button>
            </div>
        </div>
    )
}

export default BookCard;
